  `SCHED_NAME` varchar(120) NOT NULL COMMENT 'Scheduler名称',
  `TRIGGER_NAME` varchar(200) NOT NULL COMMENT 'Trigger key',
  `TRIGGER_GROUP` varchar(200) NOT NULL COMMENT 'Trigger group 名称',
  `STR_PROP_1` varchar(512) DEFAULT NULL COMMENT '字符串属性，占位用',
  `STR_PROP_2` varchar(512) DEFAULT NULL COMMENT '字符串属性，占位用',
  `STR_PROP_3` varchar(512) DEFAULT NULL COMMENT '字符串属性，占位用',
  `INT_PROP_1` int(11) DEFAULT NULL COMMENT '字符串属性，占位用',
  `INT_PROP_2` int(11) DEFAULT NULL COMMENT '字符串属性，占位用',
  `LONG_PROP_1` bigint(20) DEFAULT NULL COMMENT '字符串属性，占位用',
  `LONG_PROP_2` bigint(20) DEFAULT NULL COMMENT '字符串属性，占位用',
  `DEC_PROP_1` decimal(13,4) DEFAULT NULL COMMENT '字符串属性，占位用',
  `DEC_PROP_2` decimal(13,4) DEFAULT NULL COMMENT '字符串属性，占位用',
  `BOOL_PROP_1` varchar(1) DEFAULT NULL COMMENT '字符串属性，占位用',
  `BOOL_PROP_2` varchar(1) DEFAULT NULL COMMENT '字符串属性，占位用',
  PRIMARY KEY (`SCHED_NAME`,`TRIGGER_NAME`,`TRIGGER_GROUP`),
  CONSTRAINT `qrtz_simprop_triggers_ibfk_1` FOREIGN KEY (`SCHED_NAME`, `TRIGGER_NAME`, `TRIGGER_GROUP`) REFERENCES `qrtz_triggers` (`SCHED_NAME`, `TRIGGER_NAME`, `TRIGGER_GROUP`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储trigger属性信息';

-- ----------------------------
-- Records of qrtz_simprop_triggers
-- ----------------------------

-- ----------------------------
-- Table structure for qrtz_triggers
-- ----------------------------
DROP TABLE IF EXISTS `qrtz_triggers`;
CREATE TABLE `qrtz_triggers` (
  `SCHED_NAME` varchar(120) NOT NULL COMMENT 'Scheduler名称',
  `TRIGGER_NAME` varchar(200) NOT NULL COMMENT 'Trigger key',
  `TRIGGER_GROUP` varchar(200) NOT NULL COMMENT 'Trigger group名称',
  `JOB_NAME` varchar(200) NOT NULL COMMENT 'Job key',
  `JOB_GROUP` varchar(200) NOT NULL COMMENT 'Job group 名称',
  `DESCRIPTION` varchar(250) DEFAULT NULL COMMENT 'Trigger 描述， .withDescription()方法传入的string',
  `NEXT_FIRE_TIME` bigint(13) DEFAULT NULL COMMENT '下一次触发时间',
  `PREV_FIRE_TIME` bigint(13) DEFAULT NULL COMMENT '上一次触发时间，默认-1',
  `PRIORITY` int(11) DEFAULT NULL COMMENT 'Trigger 优先级，默认5',
  `TRIGGER_STATE` varchar(16) NOT NULL COMMENT 'Trigger状态，PAUSED_BLOCKED:停止_阻塞; PAUSED:停止; WAITING:等待执行; ACQUIRED:已获得; EXECUTING:执行中; COMPLETE:完成; BLOCKED:阻塞; ERROR:错误; DELETED:已删除',
  `TRIGGER_TYPE` varchar(8) NOT NULL COMMENT 'Cron 或 Simple',
  `START_TIME` bigint(13) NOT NULL COMMENT 'Trigger开始时间',
  `END_TIME` bigint(13) DEFAULT NULL COMMENT 'Trigger结束时间',
  `CALENDAR_NAME` varchar(200) DEFAULT NULL COMMENT 'Trigger关联的Calendar name',
  `MISFIRE_INSTR` smallint(2) DEFAULT NULL COMMENT 'misfire规则id',
  `JOB_DATA` blob COMMENT '存储Trigger的JobDataMap等',
  PRIMARY KEY (`SCHED_NAME`,`TRIGGER_NAME`,`TRIGGER_GROUP`),
  KEY `IDX_QRTZ_T_J` (`SCHED_NAME`,`JOB_NAME`,`JOB_GROUP`),
  KEY `IDX_QRTZ_T_JG` (`SCHED_NAME`,`JOB_GROUP`),
  KEY `IDX_QRTZ_T_C` (`SCHED_NAME`,`CALENDAR_NAME`),
  KEY `IDX_QRTZ_T_G` (`SCHED_NAME`,`TRIGGER_GROUP`),
  KEY `IDX_QRTZ_T_STATE` (`SCHED_NAME`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_N_STATE` (`SCHED_NAME`,`TRIGGER_NAME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_N_G_STATE` (`SCHED_NAME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_NEXT_FIRE_TIME` (`SCHED_NAME`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_ST` (`SCHED_NAME`,`TRIGGER_STATE`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_MISFIRE` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_ST_MISFIRE` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_NFT_ST_MISFIRE_GRP` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  CONSTRAINT `qrtz_triggers_ibfk_1` FOREIGN KEY (`SCHED_NAME`, `JOB_NAME`, `JOB_GROUP`) REFERENCES `qrtz_job_details` (`SCHED_NAME`, `JOB_NAME`, `JOB_GROUP`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存储已配置的Trigger的信息';

-- ----------------------------
-- Records of qrtz_triggers
-- ----------------------------

-- ----------------------------
-- Table structure for qrtz_trigger_log
-- ----------------------------
DROP TABLE IF EXISTS `qrtz_trigger_log`;
CREATE TABLE `qrtz_trigger_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `listener_name` varchar(120) NOT NULL COMMENT '监听器名称',
  `sched_name` varchar(120) NOT NULL COMMENT 'Scheduler名称',
  `instance_name` varchar(200) NOT NULL COMMENT 'Scheduler实例的唯一标识，配置文件中的Instance Id',
  `job_name` varchar(200) NOT NULL COMMENT 'Job key',
  `job_group` varchar(200) NOT NULL COMMENT 'Job group 名称',
  `job_class_name` varchar(250) NOT NULL COMMENT 'Job类名称',
  `trigger_name` varchar(200) NOT NULL COMMENT 'Trigger key',
  `trigger_group` varchar(200) NOT NULL COMMENT 'Trigger group名称',
  `start_time` datetime NOT NULL COMMENT '开始触发时间',
  `end_time` datetime DEFAULT NULL COMMENT '触发完成时间',
  `process_time` bigint(20) DEFAULT NULL COMMENT '用时(ms)',
  `pre_run_time` datetime DEFAULT NULL COMMENT '上一次触发时间',
  `next_run_time` datetime DEFAULT NULL COMMENT '下一次触发时间',
  `run_count` int(11) NOT NULL COMMENT '触发次数',
  `ip_address` varchar(200) NOT NULL COMMENT '触发节点IP,可能有多个(‘;’分隔)',
  `mis_fired` char(1) NOT NULL COMMENT '是否错过了触发（0：否；1：是）',
  `before_job_data` mediumtext COMMENT '执行前的JobDataMap数据',
  `after_job_data` mediumtext COMMENT '执行后的JobDataMap数据',
  `trigger_instruction_code` varchar(100) DEFAULT NULL COMMENT '触发指令码',
  `instr_code` varchar(100) DEFAULT NULL COMMENT '触发指令码说明',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 COMMENT='Trigger触发日志表';

-- ----------------------------
-- Records of qrtz_trigger_log
-- ----------------------------

